import React, { Component } from 'react'

export default class Phones extends Component {
    render() {
        const phonesItems = this.props.products.map(
         <div className="col-md-4">
             <div className="thumbnail text-center">

            </div>
         </div>   

        )
        return (
            <div className="row">
                {phonesItems}
            </div>
        )
    }
}
